  if (!b || !e) return
  const d1 = $d(b)
  const d2 = $d(e)
  const diffH = d2.diff(d1, 'hour', true)
  const diffD = d2.diff(d1, 'day', true)
  const info = $data.info
  if (diffD < 1) {
    info.leavedays = parseFloat(diffH.toFixed(1))
    info.timetype = 'H'
  } else {
    // info.leavedays = parseFloat(diffD.toFixed(1))
